import React, { useState } from 'react'
import {
  Box,
  Flex,
  Text,
  IconButton,
  Button,
  Stack,
  Collapse,
  Icon,
  Popover,
  PopoverTrigger,
  PopoverContent,
  useColorModeValue,
  useBreakpointValue,
  useDisclosure,
} from '@chakra-ui/react'


import {
  HamburgerIcon,
  CloseIcon,
  ChevronDownIcon,
  ChevronRightIcon,
} from '@chakra-ui/icons'


export default function NavbarComp() {

  const { colorMode, toggleColorMode } = useColorMode()



  return (
    <>

      <Button onClick={toggleColorMode}>
        {colorMode == "light" ? <i class="fa-solid fa-moon"></i> : <i class="fa-solid fa-sun"></i> }
      </Button>
    </>
  )
}
